import { Component } from 'react'
import LoginHeader from '../LoginHeader'
import loginBg from '../../assets/loginBgImage.jpg'
import './index.css'

class Login extends Component {

    renderUserNamefeild = () => {
        return (
            <div className='input-container'>
                <p className='input-label-text'>Enter Your Email:</p>
                <input className='input-box' type='text' placeholder='email' onChange={this.onChangeUsername}/>
            </div>
        )
    }

    renderPasswordfeild = () => {
        return (
            <div className='input-container'>
                <p className='input-label-text'>Enter Your Password:</p>
                <input className='input-box' type='password' placeholder='password' onChange={this.onChangePassword}/>
            </div>
        )
    }

    render() {
        return (
            <div className='login-bg-container' style={{
                backgroundImage: `url(${loginBg})`,
            }}>
                <LoginHeader/>
                <div className='login-form-bg'>
                    <form className='login-form'>
                       {this.renderUserNamefeild()}
                       {this.renderPasswordfeild()}
                    </form>
                </div>
                <button className='login-header-sm-btn'>Create Account</button>
            </div>
        )
    }
}

export default Login
